import styled from "styled-components";

const StyledPokemonInfo = styled.div``;

function SinglePokemonInfo(props) {
  console.log(props.name);
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.imgPath} />
      <StyledPokemonInfo>
        <table>

        </table>
      </StyledPokemonInfo>
    </div>
  );
}

export default SinglePokemonInfo;
